);

CREATE TABLE RetinaScanningData (
  participant_id INT,
  scan_time TIMESTAMP,
  x_coordinate INT,
  y_coordinate INT
);

CREATE TABLE EyeMovementPatterns (
  pattern_id INT,
  pattern_description TEXT,
  average_movement_speed FLOAT,
  pattern_confidence FLOAT
);

CREATE TABLE RetinaScanningData (
    participant_id INT,
    scan_time TIMESTAMP,
    eye_movement_pattern TEXT
);

CREATE TABLE ResearchStudies (
    study_id INT,
    study_name VARCHAR(255),
    researcher_name VARCHAR(255)
);

CREATE TABLE EyeMovementPatterns (
    pattern_id INT,
    pattern_name VARCHAR(255),
    pattern_description TEXT
);

CREATE TABLE StudyParticipants (
    participant_id INT,
    participant_name VARCHAR(255),
    participant_age INT,
    participant_gender VARCHAR(10)
);

CREATE TABLE Retina_Scanning_Participants (
    participant_id INT PRIMARY KEY,
    participant_name VARCHAR(50),
    age INT,
    gender VARCHAR(10)
);

CREATE TABLE Eye_Movement_Patterns (
    pattern_id INT PRIMARY KEY,
    data_id INT,
    pattern_description TEXT,
    FOREIGN KEY (data_id) REFERENCES Retina_Scanning_Data(data_id)
);

CREATE TABLE Research_Studies (
    study_id INT PRIMARY KEY,
    study_name VARCHAR(100),
    start_date DATE,
    end_date DATE
);
